INSERT INTO `airyo_chunks`(`id`,`name`,`alias`,`content`) VALUES ( '3', 'Новости - текст перед лентой', 'news_intro', '<p>Информация для сайта LASERIS.RU подготавливается на основе постоянного мониторинга средств научно-технической информации и в т.ч.: интернета, с акцентом на лазерную технику и лазерные технологии обработки материалов и, в первую очередь - лазерную сварку. При этом необходимо иметь в виду, что технологические особенности сварки и др.лазерных технологий на базе новейших мощных волоконных, диодных и дисковых лазеров - являются конфиденциальной информацией ООО"ЛазерИнформСервис" и других Исполнителей и Партнёров, и, к сожалению - не могут размещаться на сайте и  передаются Заказчикам только на договорной или контрактной основе.</p>
