<p>РАЗРАБОТКА и ПОСТАВКА ПОД «КЛЮЧ» на договорной основе ТЕХНОЛОГИИ и оборудования,
оснастки для лазерной и гибридной сварки излучением большой мощности (до 30–50–100 кВт)
волоконными, диодными, дисковыми лазерами, включая сервисное и информационное
обслуживание, обучение персонала, аттестацию и сертификацию;</p>

<p>Информационные, консультационные и маркетинговые услуги,
