<p>ООО «ЛазерИнформСервис» (ранее АОЗТ и ЗАО) работает с 30.05.1992 года – см. раздел «ИСТОРИЯ»;</p>
<p>Комплектация ЛТО выполняется от лучших мировых производителей из соображений
целесообразности и оптимальности их параметров: ЦЕНЫ и КАЧЕСТВА,
